import React, { useState, useEffect } from "react";
import { Box, Typography } from "@mui/material";
import DeleteSharpIcon from "@mui/icons-material/DeleteSharp";
import { getUsersData } from "../api";

const Users = ({ token, email }) => {
  const [userData, setuserData] = useState([]);

  useEffect(() => {
    getUsersData(email)
      .then((response) => {
        setuserData(response.data.result);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  console.log(userData.result);

  return (
    <Box>
      <Typography
        variant="h3"
        style={{ padding: "20px" }}
        display="flex"
        justifyContent={"center"}
        marginBottom="10px"
      >
        {" "}
        User Data :-{" "}
      </Typography>
      <Box
        bgcolor="#36454F"
        padding="20px"
        borderRadius={5}
        display="flex"
        alignItems="center"
        flexWrap="wrap"
        paddingTop="20px"
      >
        {userData.map((user) => (
          <Box>
            <Box flexGrow={1}>
              <Typography color="white" fontWeight="bold" paddingBottom="10px">
                {user.name}
              </Typography>
            </Box>
            <Box flexGrow={1}>
              <Typography color="white" fontWeight="bold" paddingBottom="10px">
                {user.phone}
              </Typography>
            </Box>
            <Box flexGrow={1}>
              <Typography color="white" fontWeight="bold" paddingBottom="10px">
                {user.dob}
              </Typography>
            </Box>

            <Box marginLeft="auto">
              <DeleteSharpIcon style={{ color: "white" }} />
            </Box>
          </Box>
        ))}
      </Box>
    </Box>
  );
};

export default Users;
